const TodoList = (todolist, title) => {
  return (
    <div className="todo-list">
      {todolist.map((todo) => (
        <div className="todo-preview" key={todo.id}>
          {" "}
          {}
        </div>
      ))}
    </div>
  );
};

export default TodoList;
